import React, {Component} from 'react';
import {graphql, compose} from 'react-apollo';
import {getDistrictsQuery, addProjectMutation} from '../../../queries/queries';

import {Grid, Cell} from 'react-mdl';


class AddBikes extends Component {

    constructor(props){
        super(props);
        this.state ={
            projectname: '',
            bikenumber: null,
            distributedyear: null,
            districtid: ''
        };
    }


   

    render(){
        return(
            <div className="form-style-5">
            <form>
                
                <input type="text" placeholder="Project Name"/>
            
                <input type="number" placeholder="Number of Bicycles"/>
             
                <input type="text" placeholder="YYYY"/>

                <select>
                    <option>Select IPC..</option>
                </select>

                <input type="submit" value="Add"/>
                <input type="reset" value="Reset"/>
            </form>

            
             
            </div>
            
        )
    }
}


export default AddBikes;
